// Funcin para construir el rbol de Huffman a partir de un texto
export function buildHuffmanTree(text: string) {
    // Crear un mapa de frecuencias para contar cuntas veces aparece cada carcter
    const freqMap = new Map<string, number>();
    for (const char of text) {
        freqMap.set(char, (freqMap.get(char) || 0) + 1);
    }

    // Crear una cola de prioridad con nodos basados en las frecuencias de los caracteres
    const priorityQueue: Node[] = Array.from(freqMap.entries()).map(([char, freq]) => new Node(char, freq));
    // Ordenar la cola de prioridad por frecuencia
    priorityQueue.sort((a, b) => a.compareTo(b));

    // Construir el rbol de Huffman combinando nodos hasta que quede uno solo
    while (priorityQueue.length > 1) {
        // Extraer los dos nodos con menor frecuencia
        const left = priorityQueue.shift()!;
        const right = priorityQueue.shift()!;
        // Crear un nuevo nodo que sea la combinacin de los dos nodos extrados
        const merged = new Node(null, left.freq + right.freq);
        merged.left = left;
        merged.right = right;
        // Agregar el nodo combinado de nuevo a la cola de prioridad
        priorityQueue.push(merged);
        // Volver a ordenar la cola de prioridad
        priorityQueue.sort((a, b) => a.compareTo(b));
    }

    // El nodo restante es la raz del rbol de Huffman
    const root = priorityQueue[0];

    // Calcular la profundidad mxima del rbol
    let depth = 0;
    const dfs = (node: Node | null, level = 0) => {
        if (!node) return depth = Math.max(depth, level);
        dfs(node.left, level + 1);
        dfs(node.right, level + 1);
    }
    dfs(root);

    // Retornar el rbol de Huffman y la profundidad mxima
    return {
        root: root,
        depth: depth,
    };
}

// Funcin para generar los cdigos de Huffman a partir del rbol de Huffman
export function generateCodes(
    node: Node | null,
    prefix: string = '',
    codebook: Map<string, string> = new Map()
): Map<string, string> {
    if (node) {
        // Si el nodo es una hoja, asignar el cdigo correspondiente
        if (node.char !== null) {
            codebook.set(node.char, prefix);
        }
        // Recursivamente generar cdigos para los nodos hijos
        generateCodes(node.left, prefix + '0', codebook);
        generateCodes(node.right, prefix + '1', codebook);
    }
    return codebook;
}

// Funcin para codificar un texto utilizando los cdigos de Huffman
